import styled from 'styled-components';

const Button = styled.button`
  background-color: #24a19c;
  padding: 8px 20px;
  border: 1px solid #24a19c;
  color: #fff;
  margin: 2px 5px;
  cursor: pointer;
  font-size: 0.85rem;
  text-transform: uppercase;
  font-weight: 600;
  border-radius: 7px;
`

export default Button
